import './App.css';
import ProfilePicture from './ProfilePicture.svg';
import Navigation from './Navigation/Navigation';
import menudiv from './Navigation/menudiv.svg';

function App() {
  return (
    <div className="App">
      <Navigation/>
      <img className="menudivider" src={menudiv}/>
      <img className="ProfilePicture" src={ProfilePicture} />
    </div>
  );
}

export default App;
